import React from 'react';
import Card from 'react-bootstrap/Card';
import styled from 'styled-components';
import teamData from './team-data';
import { Draggable } from "react-beautiful-dnd";
import logo from './images/miami-dolphins-logo-png-6.png';
import './teamCard.css';

const Container = styled.div`


    margin-bottom: 8px;
    height: 100px;

`;



export default class TeamCard extends React.Component {

    constructor(props) {
        super(props)
        console.log(props.teams['team-1'])
        this.state = {
            id: props.id,
            teamId: props.value,
            teamName: teamData[props.value],
            //teamLink: null,
            //teamImage: null
        }

        //alert(this.state.teamName)

    }

    //alert(this.props.teamId)

    render() {

        return (
            <Draggable draggableId={this.props.id} index={this.props.index}>
                { (provided) => (
                    <Container
                        {...provided.draggableProps}
                        {...provided.dragHandleProps}
                        innerRef={provided.innerRef}
                        ref={provided.innerRef}>
                        <Card className="teamCard" Card bg="info" text="white">
                            <Card.Img src={logo} alt="Card image" />
                            <Card.ImgOverlay>
                            <Card.Header> {this.state.teamName}</Card.Header>

                            <Card.Text> Pick #:{this.state.id} </Card.Text>
                            </Card.ImgOverlay>
                        </Card>
                    </Container>
                )
                }
            </Draggable>
        )
    }

}
